import "./../UI/Todo.css";
import icon_check from "./../icon-check.svg";
import icon_cross from "./../icon-cross.svg";
import React from "react";
const TodoResults = (props) => {
  const t = document.getElementsByClassName(`test_change${props.keys}`);
  const FindIndex = () => {
    console.log(t)
    t[0].style.color = 'red'
    props.checkState(props.keys);
    props.CheckLen();
  };
  return (
    <li>
      <div className="list-check">
        <button className="Checked" onClick={FindIndex}>
          <img src={icon_check} alt="" />
          <div className="Checked-Border"></div>
        </button>
        <p className={`test_change${props.keys}`}>{props.value}</p>
      </div>
      <button className="Deleted">
        <img src={icon_cross} alt="" />
      </button>
    </li>
  );
};
export default TodoResults;
